INSERT INTO `soal` (`no_soal`, `pertanyaan`, `a`, `b`, `c`, `d`, `e`, `jawaban_benar`) VALUES
(1, 'Kegiatan utama dari bank umum adalah …', 'menghimpun simpanan dari masyarakat', 'memberikan pinjaman kredit kepada anggota', 'memberikan pinjaman antarbank', 'melaksanakan kebijakan moneter', 'menghimpun dana dari karyawan', 'a'),
(2, 'Dalam bidang asuransi dikenal adanya surat perjanjian yang disebut dengan …', 'inkaso', 'LC', 'premi', 'leasing', 'polis', 'a'),
(3, 'Pihak-pihak yang terlibat dalam kegiatan usaha anjak piutang adalah …', 'klien dan factoring', 'debitur dan perusahaan agen', 'dealer dan agen tunggal', 'lesse dan lessor', 'debitur dan konsumen', 'a'),
(4, 'Untuk mendapatkan pinjaman dari pegadaian, nasabah harus menyerahkan …', 'kartu anggota', 'rekening koran', 'polsi asuransi', 'bukti pembayaran', 'barang jaminan', 'e'),
(5, 'Di bawah ini yang termasuk aktivitas Bank Perkreditan Rakyat (BPR) adalah …', 'menyalurkan Kredit Usaha Rakyat (KUR)', 'melakukan pernyertaan modal', 'membuat uang kartal', 'melakukan kegiatan perdagangan valuta asing (Valas)', 'memberikan usaha di bidang asuransi', 'a'),
(6, 'Bank-bank yang ada di Indonesia berdasarkan kegiatannya dibedakan menjadi …', 'Bank Indonesia (BI), bank syariah, bank swasta, dan bank umum', 'bank sentral, bank syariah, bank umum, dan Bank Perkreditan Rakyat (BPR)', 'bank pemerintah, bank syariah, bank swasta, dan bank campuran', 'bank swasta, bank perseorangan, Bank Perkreditan Rakyat (BPR, dan bank persekutuan', 'bank umum, bank devisa, bank swasta, dan Bank Pemerintah Daerah (BPD)', 'b'),
(7, 'Salah satu kewenangan bank sentral dalam mengatur dan menyelenggarakan sistem pembayaran adalah  …', 'operasi pasar terbuka', 'menetapkan penggunakan alat pembayaran', 'menetapkan peraturan di bidang perbankan', 'pengaturan kredit atau pembiayaan', 'melakukan pengawasan bank secara langsung maupun tidak langsung', 'e'),
(8, 'Berikut ini merupakan cara bank dalam menghimpun dan menyalurkan dana kepada masyatakat.</br>\n1)	deposito berjangka</br>\n2)	tabungan</br>\n3)	kredit dengan jaminan surat berharga</br>\n4)	LC</br>\n5)	giro</br>\n6)	Kredit aksep</br>\nYang termasuk kredit pasif yaitu …\n', '1,2,5', '1,3,4', '1,4,6', '2,3,5', '2,3,6', 'a'),
(9, 'Bank syariah dalam menyalurkan aktivitasnya memberikan modal kepada nasabah dan nasabah memberikan keahliannya serta pembagian laba menurut rasio yang disetujui, berarti menerapkan prinsip …', 'ijarah', 'ijarah wa iqtina', 'mudharabah', 'murabahah', 'musharakah', 'c'),
(10, 'Perbedaan yang mendasar antara bank syariah dengan bank konvensional terletak pada …. ', 'jenis nasabahnya', 'besarnya laba yang diperoleh', 'adanya larangan penggunaan bunga', 'cara mengelola uang', 'jumlah nasabahnya', 'c'),
(11, 'Berikut ini merupakan tugas bank sentral dan bank umum.</br>\n1)	menghimpun dana dari masyarakat</br>\n2)	mengatur dan mengawasi bank-bank</br>\n3)	menyalurkan dana kepada masyarakat dalam bentuk kredit</br>\n4)	menetapkan dan melaksanakan kebijakan moneter</br>\n5)	mengatur dan menjaga sistem pembayaran</br>\nDari tugas-tugas tersebut, yang termasuk tugas bank sentral adalah …', '1,2,3', '1,2,4', '2,3,4', '2,4,5', '3,4,5', 'd'),
(12, 'Kegiatan yang tidak boleh dilakukan oleh Bank Perkreditan Rakyat (BPR) yaitu …', 'melaksanakan kegiatan pembiayaan atas dasar bagi hasil', 'menempatkan dananya dalam SBI', 'menyalurkan dana dalam bentuk kredit kepada publik', 'menghimpun dana dari publik dalam tagungan', 'melaksanakan kegiatan perdagangan Valuta Asing (Valas)', 'e'),
(13, 'Bank Indonesia (BI) secara khusus diatur dalam …', 'UU No 34 tahun 1999', 'UU No 23 tahun 1999', 'UU No 17 tahun 2012', 'UU No 5 tahun 1999', 'UU No 10 tahun 1998', 'b'),
(14, 'Otoritas Jasa Keuangan (OJK) resmi beroperasi penuh pada …', '22 Desember 2013', '31 Desember 2012', '22 November 2011', '31 Desember 2013', '1 Januari 2014', 'e'),
(15, 'Otoritas Jasa Keuangan (OJK) didirikan untuk menggantikan peran …', 'Menteri Perdagangan', 'Menteri Keuangan', 'Badan Pengawas Keuangan', 'Inspektorat Keuangan', 'Bapepam-LK', 'e'),
(16, 'Otoritas Jasa Keuangan (OJK) dipimpin oleh …', 'direktur jenderal', 'ketua dewan komisioner', 'dewan direksi', 'direksi', 'menteri keuangan', 'b'),
(17, 'Tugas menjaga stabilitas sistem keuangan dilaksanakan oleh …', 'pasar modal', 'Otoritas Jasa Keuangan (OJK)', 'bank umum', 'menteri keuangan', 'Bank Indonesia', 'e'),
(18, 'Iuran anggota atau nasabah untuk sebuah pertanggungjawaban risiko pada asuransi disebut …', 'deviden', 'setoran', 'retribusi', 'premi', 'simpanan wajib', 'd'),
(19, 'Stabilnya sistem keuangan bisa mengakibatkan munculnya beberapa kondisi berikut ini, kecuali …', 'tingginya biaya penyelamatan terhadap sistem keuangan jika terjadi krisis yang bersifat sistemik', 'kebijakan moneter menjadi berjalan efektif', 'transmisi kebijakan moneter tidak berfungsi secara normal', 'ketidakpercayaan mesyarakat terhadap sistem keuangan yang diikuti dengan perilaku para investor untuk menarik dananya', 'fungsi intermediasi tidak bisa berjalan sebagaimana mestinya akibat alokasi dana yang tidak tepat', 'e'),
(20, 'Bank adalah lembaga keuangan, hal ini berarti bahwa bank adalah bada usaha yang kekayaan terutama dalam bentuk aset keuangan serta bermotivasi profit (laba) dan juga sosial, jadi tidak mencari keuntungan saja. Pengertian bank tersebut dikemukakan oleh …', 'Kasmir', 'Malayu S.P. Hasibuan', 'Pierson', 'G.M. Verryn Stuart', 'Somary', 'b'),
(21, 'Permintaan terhadap suatu barang dipengaruhi oleh faktor di bawah ini, kecuali.....', 'Jumlah penduduk', 'Pendapatan ', 'Kemajuan teknologi', 'Harga barang lain', 'Selera konsumen', 'c'),
(22, 'Hukum permintaan menyatakan bahwa jika....', 'pendapatan konsumen naik, permintaan barang meningkat', 'pendapatan konsumen naik, permintaan barang berkurang', 'harga suatu barang naik, permintaan barang tersebut berkurang', 'harga suatu barang turun, jumlah barang yang diminta meningkat', 'harga suatu barang turun, permintaan barang tersebut berkurang ', 'c'),
(23, 'Walaupun harga beras meningkat karena persediaan berkurang, permintaan konsumen terhadap beras tidak banyak berubah. Kondisi ini menunjukkan bahwa beras memiliki permintaan yang bersifat...', 'Elastis', 'Inelastis', 'Elastis sempurna', 'Uniter', 'Inelastis sempurna', 'b'),
(24, 'Bila koefisien elastis silang antara dua macam barang bertanda positif mempunyai arti...', 'Kedua barang tersebut adalah barang publik', 'Kedua barang tersebut adalah barang inferior', 'Kedua barang tersebut adalah barang komplementer', 'Kedua barang tersebut adalah barang substitusi', 'Tidak ada hubungan antara dua barang tersebut', 'd'),
(25, 'Dalam suatu perusahaan, sumber daya alam, tenaga kerja, modal, jiwa kewirausahaan, dan informasi merupakan contoh dari...', 'faktor produksi', 'barang konsumsi', 'barang modal', 'pelaku ekonomi', 'output produksi', 'a'),
(26, 'Prinsip ekonomi bagi produsen adalah cara-cara mencapai...', 'output maksimum', 'biaya minimum', 'output maksimum dengan biaya minimum', 'output tertentu dengan biaya minimum', 'output maksimum dengan biaya marginal', 'c'),
(27, 'Perhatikan alat pemuas kebutuhan berikut ini!</br>\n1)	Kompor dengan oven</br>\n2)	Tinta dengan balpoint</br>\n3)	Mobil dengan motor</br>\n4)	Sepatu dengan kaos kaki</br>\n5)	Beras dengan jagung</br>\n6)	Kopi dengan gula</br>\nDari alat pemuas di atas, yang merupakan contoh benda komplementer adalah....\n', '1,2, dan 3', '1,3, dan 5', '2,3, dan 4', '2,4, dan 6', '4,5, dan 6', 'd'),
(28, 'Suatu negara menyerahkan kegiatan ekonomi kepada pemerintah dan produksi, distribusi dan konsumsi diatur oleh pemerintah tetapi masyarakat tidak mendapat kebebasan dalam melakukan kegiatan ekonomi. Gambaran diatas menunjukkan bahwa negara tersebut menggunakan sistem ekonomi….', 'tradisional', 'komando', 'liberal', 'campuran', 'demokratis', 'b'),
(29, 'Diketahui fungsi permintaan barang X adalah 2Qdx = 10 – Px, di mana Qdx = kuantitas barang X dan Px = harga barang X. Jika Px = 4, maka elastisitas titik harga permintaan adalah....', '-1/4', '-2/4', '-3/4', '-2/3', '-3/2', 'd'),
(30, 'Dalam jangka panjang hasil keseimbangan di pasar persaingan sempurna dan pasar persaingan monopolistik adalah sama dalam hal...', 'harga yang diterima produsen', 'jumlah output yang diproduksi', 'pemanfaatan skala ekonomi', 'profit yang diterima produsen', 'biaya per unit output', 'd'),
(31, 'Kurva yang menggambarkan berbagai kemungkinan kombinasi output maksimum pada saat sumber daya ekonomi dan teknologi digunakan sepenuhnya dinamakan....', 'Total Product Curve', 'Production Possibility Curve', 'Isoquant Curve', 'Price Consumption Curve', 'Marginal Product Curve', 'b'),
(32, 'Harga produksi dari barang X adalah Rp50.000 per unit. Setelah ditambah dengan ongkos distribusi dan keuntungan, harga barang X di pasar adalah 70.000 per unit. Sesuai dengan ketentuan UU setiap barang yang diperjualbelikan di perekonomian harus dikenakan pajak penjualan 10%. Kebijakan penetapan pajak penjualan akan mnyebabkan....', 'tidak akan menggeser baik kurva permintaan maupun kurva penawaran dari barang X', 'kurva permintaan barang X bergeser ke sebelah kanan bawah', 'harga permintaan barang X bergeser ke sebelah kiri bawah ', 'harga penawaran barang X bergeser ke sebelah kiri bawah ', 'kurva penawaran barang X bergeser ke sebelah kiri atas', 'b'),
(33, 'Pernyataan yang benar berikut ini adalah...', 'kurva isocost akan berotasi jika terjadi perubahan kemampuan anggaran perusahaan', 'kurva iocost akan bergeser jika terjadi perubahan harga salah satu macam faktor produksi', 'kurva isocost akan berotasi jika terjadi perubahan harga dua macam barang faktor produksi', 'kurva isocost akan bergeser sejajar jika terjadi perubahan kemampuan anggaran perusahaan', 'kurva isocost akan berotasi jika terjadi perubahan kemampuan anggaran konsumen', 'd'),
(34, 'Diketahui total biaya (TC) dari perusahaan Z adalah:</br> \nTC = Q3 + 10Q2 =300Q, maka biaya rata-rata (AC) akan mencapai minimum jika perusahaan berproduksi pada kuantitas (Q)....\n', '5 unit', '6 unit', '5,5 unit', '4 unit', '4,5 unit', 'a'),
(35, 'Biaya peluang (opportunity cost) muncul karena...', 'Adanya alternatif pilihan', 'Adanya komponen biaya yang tidak bisa dimasukkan ke dalam biaya tetap', 'Adanya komponen biaya yang tidak bisa dimasukkan ke dalam biaya variabel', 'Tidak adanya alternatif lain', 'Adanya biaya yang tidak tertagih', 'a'),
(36, 'Salah satu ciri khas sistem ekonomi pasar adalah...', 'diterapkan di banyak negara', 'harga diserahkan kepada sistem mekanisme pasar', 'pemerintah ikut campur dalam mekanisme pasar', 'pemerintah memberikan sebagian pengelolaan sumber daya kepada pasar', 'perdagangan diatur dalam taraf tertentu', 'b'),
(37, 'Kurva engel menunjukkan hubungan antara tingkat....', 'pendapatan dengan pengeluaran', 'harga dan pengeluaran', 'pendapatan dengan jumlah barang yang dibeli', 'utilitas dengan harga ', 'pendapatan dengan harga barang yang dibeli', 'c'),
(38, 'Dalam melakukan produksi barang akan terjadi law of diminishing return pada saat setelah...', 'produk total mencapai maksimum', 'biaya per unit mencapai minimum', 'produk marginal mencapai maksimum', 'penggunaan input sudah maksimum', 'produk rata-rata maksimum', 'c'),
(39, 'Perhatikan ciri-ciri pasar barang berikut ini!</br> \n1)	Terdapat beberapa produsen yang menguasai pasar.</br> \n2)	Barang yang diperdagangkan bersifat homogen.</br>\n3)	Masing-masing penjual mempunyai ke-kuatan menentukan harga.</br> \n4)	Produsen bebas keluar masuk pasar.</br> \n5)	Penjual sebagai price taker.</br> \n6)	Produsen baru sulit memasuki pasar.</br> \n		\nYang termasuk ciri-ciri pasar oligopoli adalah ….\n', '(1), (2), dan (3) ', '(1), (3), dan (6) ', '(2), (4), dan (5) ', '(3), (4), dan (5) ', '(4), (5), dan (6) ', 'b'),
(40, 'Diketahui :</br>\nFungsi Permintaan Q = 2 – 0,5P</br>\nFungsi Penawaran Q = -2 + P</br>\nBila pemerintah menarik pajak T = 2, maka keseimbangan harga (P) dan kuantitas (Q) setelah pajak adalah...\n', '(2,67 ; 1,33)', '(2,67 ; 0)', '(4 ; 0)', '(4 ; 1,33)', '(2 ; 4)', 'c'),
(41, 'Bidang akuntansi yang kegiatannya berkaitan dengan penetapan biaya produksi dimana digunaka oleh perusahaan untuk menentukan kebijakan produksi pada masa yang akan datang adalah', 'Akuntansi pemerintah', 'Akuntansi manajemen', 'Akuntansi keuangan', 'Akuntansi biaya', 'Akuntansi anggaran', 'd'),
(42, 'Yang termasuk pihak ekstern sebagai pemakai informasi akuntansi adalah sebagai berikut kecuali', 'Investor', 'Karyawan perusahaan', 'Manajer perusahaan', 'Kreditor', 'Pemasok', 'c'),
(43, 'Akuntan yang menjalankan fungsi pemeriksaan secara independen terhadap laporan keuangan perusahaan dan organisasi lain dan hasil laporan keuangan dinyatakan dalam laporan akuntansi yang berisi pendapat tentang kewajaran atau kelayakan laporan keuangan yang diperiksanya adalah profesi akuntan', 'Privat', 'Public', 'Pemerintah', 'Intern', 'Pendidik', 'b'),
(44, 'Rumusan persamaan dasar akuntansi  yang benar ialah', 'Harta = kewajiban – modal', 'Harta = modal – kewajiban', 'Asset = liabilitas + ekuitas', 'Kewajiban = harta + modal', 'Ekuitas = liabilitas + asset', 'c'),
(45, 'Diketahui bahwa asset yang dimiliki oleh PT barakoh adalah sebesar Rp. 28.000.000,- sedangkan liabilitasnya sebesar Rp. 16.000.000,-. Maka besarnya ekuitas yang dimiliki PT Barokah ialah', 'Rp. 12.000.000,-', 'Rp. 44.000.000,-', 'Rp. 21.000.000,-', 'Rp. 7.000.000,-', 'Rp. 14.000.000,-', 'a'),
