(83, 'Yang tidak termasuk dalam jasa tidak kena PPN adalah...', 'Jasa penyiaran yang bersifat komersial', 'Jasa perhotelan', 'Jasa dokter', 'Jasa keagamaan', 'Jasa kesenian dan hiburan', 'a'),
(84, '“Iuran rakyat yang disetorkan melalui kas negara atas dasar pembangunan tertentu dari jasa atau barang milik negara yang digunakan oleh orang-orang tertentu.” Pernyataan diatas merupakan definisi dari salah satu pungutan lain selain pajak, yaitu...', 'Retribusi', 'Cukai', 'Bea masuk dan bea keluar', 'Sumbangan', 'Pungutan liar', 'a'),
(85, 'Salah satu fungsi pajak adalah fungsi anggaran (budgeter) maksudnya adalah...', 'Untuk memasukkan dana secara optimal ke dalam kas negara berdasarkan undang-undang yang berlaku.', 'Untuk menstabilkan kondisi dan keadaan perekonomian.', 'Untuk melaksanakan atau mengatur kebijakan negara dalam lapangan sosial dan ekonomi.', 'Untuk menyesuaikan dan menyeimbangkan antara pembagian pendapatan dengan esejahteraan masyarakat.', 'Untuk membiayai dan menyediakan barang atau jasa yang dibutuhkan masyarakat.', 'c'),
(86, 'Yang termasuk dalam tarif pajak adalah...', 'Tarif tunggal', 'Tarif umum', 'Tarif tetap', 'Tarif preferensi', 'Tarif konvensional', 'd'),
(87, 'Pajak berdasarkan golongan dibagi menjadi 2, langsung dan tidak langsung. Berikut beberapa jenis pajak berdasarkan golongan:</br>\n1)	Pajak Penjualan atas Barang Mewah</br>\n2)	Pajak Pertambahan Nilai (PPN)</br>\n3)	Pajak Penghasilan (PPh)</br>\n4)	Bea Materai</br>\n5)	Pajak Bumi dan Bangunan (PBB)</br>\nYang termasuk pajak tidak langsung adalah...', '1, 2, dan 3', '2, 3, dan 4', '3, 4, dan 5', '1, 2, dan 4', '1, 2, dan 5', 'd'),
(88, 'Pajak yang dikenakan berdasarkan keadaan, peristiwa dan/atau perbuatan yang dapat menimbulkan kewajiban membayar pajak tanpa melihat subjeknya adalah definisi pajak...', 'Subjektif', 'Kolektif', 'Partisipatif', 'Objektif', 'Konsumtif', 'b'),
(89, 'Yang termasuk dalam jenis pajak pusat adalah, kecuali...', 'Bea Perolehan Hak atas Tanah dan Bangunan', 'Pajak Rokok', 'Pajak Migas', 'Pajak Ekspor', 'Bea Materai', 'c'),
(90, '\"Hukum pajak yang memuat ketentuan-ketentuan tentang siapa-siapa yang dikenakan pajak, dan siapa-siapa yang dikecualikan dari pengenaan pajak, apa saja yang dikenakan pajak dan berapa yang harus dibayar.”, merupakan pengertian hukum pajak...', 'Formal', 'Non-formal', 'Material', 'Konvensional', 'Terikat', 'e'),
(91, 'Seseorang berada di suatu tempat (negara), maka ia otomatis memiliki kewajiban untuk membayar pajak. Bahkan, ketika ia sedang melakukan sebuah perjalanan di dalam maupun luar negeri, pajak wajib tetap dibayarkan selama catatan administrasi tetap menyantumkan namanya di catatan wilayah suatu negara, adalah definisi dari...', 'Asas sumber', 'Asas wilayah atau teritorial', 'Asas legalitas', 'Asas umum', 'Asas kebangsaan atau nasionalitas', 'c'),
(92, 'Sistem pemungutan pajak yang memberikan wewenang kepada pihak lain atau pihak ketiga (selain pemerintah dan wajib pajak) untuk memotong dan memungut besarnya pajak yang terhutang oleh wajib pajak adalah...', 'Official Assessment System', 'Informal Assessment System', 'With Holding System', 'Semi-self Assessment System', 'Self Assessment System', 'a'),
(93, '“Hutang pajak timbul karena dikeluarkannya Surat Ketetapan Pajak oleh fiskus.” Dalam timbulnya utang pajak terdapat 2 ajaran, ajaran manakah yang memiliki definisi tersebut...', 'Ajaran formil', 'Ajaran materiil', 'Ajaran non-formil', 'Ajaran non-materiil', 'Ajaran konvensional', 'a'),
(94, 'Ajaran formil diterapkan apabila pemungutan pajak dilakukan dengan...', 'Official Assessment System', 'Informal Assessment System', 'With Holding System', 'Semi-self Assessment System', 'Self Assessment System', 'e'),
(95, 'Ajaran materiil diterapkan apabila pemungutan pajak dilakukan dengan...', 'Official Assessment System', 'Informal Assessment System', 'With Holding System', 'Semi-self Assessment System', 'Self Assessment System', 'c'),
(96, 'Berdasarkan undang-undang perpajakan, utang pajak dapat dihilangkan dengan...', 'Tiga cara', 'Empat cara', 'Lima cara', 'Enam cara', 'Tujuh cara', 'b'),
(97, 'Dalam menghilangkan utang pajak terdapat cara kompensasi, kompensasi dapat dilakukan apabila wajib pajak...', 'Kurang dalam membayar pajak', 'Kelebihan dalam membayar pajak', 'Tidak membayar pajak', 'Belum membayar pajak', 'Sudah membayar pajak', 'b'),
(98, 'Tarif pajak proporsional adalah...', 'Penetapan tarif pajak yang semakin menaik berdasarkan peningkatan pendapat. Semakin tinggi pendapatan, semakin tinggi pula tarif pajaknya.', 'Penetapan tarif pajak yang dikenakan kepada wajib pajak menurut persentase tetap dari semua penghasilan. Semakin tinggi pendapan, semakin tinggi pula tarif pajaknya.', 'Penetapan tarif pajak dengan persentase pajak yang semakin rendah apabila objek yang kena pajak semakin besar nilainya.', 'Penetapan tarif berupa jumlah atau angka yang tetap, berapa pun besarnya dasar pengenaan pajak.', 'Penetapan tarif pajak yang ditentukan oleh wajib pajak.', 'd'),
(99, 'Yang dimaksud dengan prinsip kesamaan (equality) dalam pemungutan pajak adalah...', 'Pemungutan pajak harus tegas, jelas, dan pasti kebenarannya.', 'Jangan sampai pajak memberatkan wajib pajak, sehingga wajib pajak harus sesuai dengan tingkat kemampuan wajib pajak dan sebaiknya dilakukan disaat yang tepat.', 'Pemungutan pajak harus dilakukan secara bersamaan.', 'Pemungutan pajak harus dilakukan dengan seadil-adilnya sesuai dengan tingkat kemampuan wajib pajak.', 'Pada saat menetapkan dan memungut pajak harus mempertimbangkan biaya pemungutan pajak. Jangan sampai biaya pemungutan lebih tinggi dari pajak yang dikenakan.', 'c'),
(100, 'Subjek pajak dalam negeri ada 2, salah satunya adalah orang pribadi yang bertempat tinggal di Indonesia, orang pribadi yang berada di Indonesia lebih dari ... hari dari jangka waktu 12 bulan atau orang pribadi yang dalam suatu tahun pajak berada di Indonesia dan mempunyai niat untuk bertempat tinggal di Indonesia.', '100 hari', '150 hari', '183 hari', '235 hari', '365 hari', 'd');
